        width: '70%',
        marginTop: 80,
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        flexWrap: 'wrap',
    },
}));

const Info =  () => {

    const classes = useStyles();

    return (

        <Paper className={classes.paper}>

